window.bookSummaryJSON = "<p>Wanted is a <b>DARK GRAY </b>romance novella with high spice and low plot. This home invasion story will leave you questioning if you should leave your door open at night.<br> <br> <b>I'm wanted.</b></p> <p>On the lam, running from the law and my mistakes. The house tucked into the trees seems safe—an excellent place to hide out.</p> <p>Once inside, I find something unexpected. A nurse that can do more than heal my wounds. But the longer I'm awake, the more reality starts to blur, and I can't tell what's real and what's not anymore.</p> <p>Plagued by ill fantasies and temptation, I try to keep her safe from me. It works until the lines between us also begin to blur.</p> <p>Vanessa, like her home, will never be the same once I get inside.</p> <p><b><i>Wanted</i></b><b> is a dark, spicy novella with a plethora of content advisories. It’s part of Lauren Biel's “after dark” collection, and warnings on LaurenBiel.com should be taken seriously.</b></p>"; 
